import React, { useState } from "react";
import axios from "axios";
import "./App.css";

const App = () => {
  // 상태 관리
  const [deliveryInfo, setDeliveryInfo] = useState({
    deliveryAddress: "",
    recipient: "",
    deliveryInstruction: "",
  });
  const [orderDetails, setOrderDetails] = useState({
    productId: 1, // 예시 ID, 실제 상품 ID로 대체 필요
    quantity: 1,
  });

  const [paymentMethod, setPaymentMethod] = useState(""); // 결제 수단 ID
  const [paymentResult, setPaymentResult] = useState(""); // 결제 결과 메시지

  // 사용자 입력 처리 함수
  const handleChange = (e) => {
    const { name, value } = e.target;
    setDeliveryInfo((prev) => ({
      ...prev,
      [name]: value,
    }));
  };

  // 결제 처리 함수
  const handlePayment = async () => {
    try {
      // 주문 정보 백엔드로 전송
      const orderResponse = await axios.post("/orders", {
        ...deliveryInfo,
        ...orderDetails,
      });

      if (orderResponse.status === 201) {
        // 결제 요청
        const paymentResponse = await axios.post("/payments", {
          orderId: orderResponse.data.orderId,
          methodId: paymentMethod,
          amount: 26702, // 결제 금액, 실제 계산 로직 필요
        });

        if (paymentResponse.status === 200) {
          setPaymentResult("결제가 성공적으로 처리되었습니다.");
        }
      }
    } catch (error) {
      setPaymentResult("결제 처리 중 오류가 발생했습니다.");
      console.error("Payment error:", error);
    }
  };
  return (
    <div className="app">
      {/* 배송 정보 입력 폼 */}
      <div className="order-payment">
        <h2>Order / Payment</h2>
        <input
          type="text"
          name="deliveryAddress"
          placeholder="배송지"
          onChange={handleChange}
        />
        <input
          type="text"
          name="recipient"
          placeholder="배송지 변경"
          onChange={handleChange}
        />
        <input
          type="text"
          name="deliveryInstruction"
          placeholder="부재시 집 앞에 넣어주세요"
          onChange={handleChange}
        />
      </div>

      <div className="order-details">
        {/* 상품 정보, 수량, 가격 등 표시 */}
        <h3>토스간편결제 + 쿠폰</h3>
        <p>결제 금액: 26,702원</p>
        <table>
          <thead>
            <tr>
              <th>상품</th>
              <th>수량</th>
              <th>판매가</th>
              <th>배송</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td>
                <img src="product-image.jpg" alt="Product" />
                <span>[토르시]</span>
                <span>데일리 무지 숏슬리브 - White</span>
                <span>옵션: 화이트/M</span>
              </td>
              <td>1개</td>
              <td>33,800원</td>
              <td>
                예상 발송일
                <br />
                (일)
              </td>
            </tr>
          </tbody>
          <tfoot>
            <tr>
              <td colSpan="2">상품 합계</td>
              <td>49,500원</td>
              <td></td>
            </tr>
            <tr>
              <td colSpan="2">배송비</td>
              <td>배송비 무료</td>
              <td></td>
            </tr>
            <tr>
              <td colSpan="2">상품 할인</td>
              <td>-15,700원</td>
              <td></td>
            </tr>
            <tr>
              <td colSpan="2">총 할인 금액</td>
              <td>-22,798원</td>
              <td></td>
            </tr>
            <tr>
              <td colSpan="2">최종 결제 금액</td>
              <td>26,702원</td>
              <td></td>
            </tr>
          </tfoot>
        </table>
      </div>

      {/* 결제 정보 및 버튼 */}
      <div className="payment-button">
        <button onClick={handlePayment}>결제하기</button>
      </div>
      {/* 결제 결과 메시지 */}
      {paymentResult && <p>{paymentResult}</p>}
    </div>
  );
};

export default App;
